import 'package:ieca_mobile/_import.dart';

class UmHymnsOkulitumbika{
  static List<HymnsContent> list = [
    HymnsContent(id: 2460, position: 1, content: "Cosi wa panga, a Suku linga; \nOve Unungi yiwa yolombia. \nAme ndituma, nambule ño, \nKu nungi ndomo ove wa panga.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_203, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2461, position: 2, content: "Cosi wa panga, a Suku linga; \nNjupe ovina vioku nateka. \nKomuenyo wange njongola lika, \nOku ku vumba lutima wosi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_203, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2462, position: 3, content: "Cosi wa panga, a Suku linga; \nNdo ñangule, oco ñolisue. \nNyihe ongusu poku kanguiwa, \nNdokuti niama lika kokuove.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_203, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2463, position: 4, content: "Cosi wa panga, a Suku linga; \nNjukise levi viove viocili. \nNyihe uloño woku kuatisa, \nVa kuawelema va ku sukila.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_203, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2464, position: 1, content: "A Suku yetu, ukuahenda, \nKuatisa omãla vove vosi. \nVa tunge ociseveto ciwa \nCovitumbulukila viya.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_204, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2465, position: 2, content: "Tu ambate omindikiso yetu \nLepandi kuenda esunguluko, \nHa tu eci ongangu ya posoka \nKomanu vosi va nyelela.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_204, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2466, position: 3, content: "Tu longe oku litata ciwa. \nTu yule ayonjo otembo yosi. \nOco ka tu ka tatekiwe, \nNda tu yongola oku amako.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_204, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2467, position: 4, content: "Tu lavulule imuenyo vietu. \nTu lipatise etu muele. \nTu imbe ovaso konjovoli. \nKa tu ka yokokele omanu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_204, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2468, position: 5, content: "Tu avele ombembua lesumbilo; \nKa tu ka suvalise omunu. \nTu ihe utima wocisola \nWoku kuatisa omanu vosi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_204, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2469, position: 1, content: "Si kuete, a Tate ocipango \nCiliñi, te cove. \nCosi wa panga, a Suku, \nHaico ci lingiwe.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_205, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2470, position: 2, content: "Ndi litumbika kokuove, \nSi sipo violuali. \nOvina ove o mangisa, \nOvio vi lingiwe.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_205, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2471, position: 3, content: "Si ka tatãle, a Suku; \nNdi tave ocili. \nEvi nda sima havioko; \nViove vi lingiwe.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_205, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2472, position: 1, content: "A Yesu, ndo njukinye utima \nWoku ku sola ocili, \nHa si tekela kuwa wove \nLoku suvuka eviho.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_206, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2473, position: 2, content: "Vunene wove mu takate \nOku leñela kuange. \nOmuenyo wove u nyolele \nEvi vi koka okufa.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_206, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2474, position: 3, content: "Esunga liove li nyimule \nOvisimilo vivi. \nVutima mu pue owelema; \nMu lue utanya wove.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_206, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2475, position: 4, content: "Omuenyo wange u linge wove; \nWove u linge wange. \nOcali cove ci mosuise, \nOco hu sesamele.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_206, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2476, position: 5, content: "Ñuatise oku sunguluka \nHa siu ku vumbi lika. \nTiamisa utima wange wosi \nKuevi viu ku kemainya.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_206, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2477, position: 1, content: "A Yesu, ove wa ndanda \nLolohali via lova. \nAme ndi litumbika \nPolomai via tomiwa.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_207, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2478, position: 2, content: "Cilo cosi hu ci iha; \nNdi likapa kutito. \nCosi civi ndi ci sia; \nÑuata komindikiso.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_207, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2479, position: 3, content: "Ndaño sanga esepu, \nNdaño sanga epese, \nA Yesu, ove hu kuama \nToke nula omuenyo.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_207, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2480, position: 4, content: "Nyihe utõi lekolelo; \nSi ka kuate usumba. \nNyihe utima wepandi \nTe mitila kulamba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_207, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2481, position: 1, content: "Limuisi otembo yoku felevela. \nVanguli la Yesu kuosi wu kasi. \nLivali ukamba lomãla vaye. \nEteke keteke tiameli kokua’e.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_208, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2482, position: 2, content: "Limuisi otembo yoku felevela. \nOluali lua puiya; lu tu lueyisa. \nWa tiama ku Yesu u setahãla; \nEye eca komanu ovitua viwa.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_208, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2483, position: 3, content: "Limuisi otembo yoku felevela. \nKo ka pambukili konjila yivi. \nTekuli itima londaka yaye. \nYesu eye Undipo; o tu songuila.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_208, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2484, position: 4, content: "Limuise otembo yoku felevela. \nLiyeki ku Yesu, ho litumbika. \nEspiritu Sandu liu longi ciwa, \nHo vumbi Onjovoli lesunguluko.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_208, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2485, position: 1, content: "Ndeyile ndukombe, si tumãla kulo; \nPuãi ndicingendeleyi kofeka yikuavo. \nNda linga omunga ya Tate kovailu; \nNdeya lupange Wosoma.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_209, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2486, content: "Owo owanji nda nena \nOkuti Suku wo soli: \n«Kakandu tinduki \nTavi ya lombili» \nEtali tavi ku Suku.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_209, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2487, position: 2, content: "Ocihandeleko, ceci co  komanu \nVa tunde keviho va siepo akandu \nVosi va pokola, lahe va ka viala; \nOwo upange Wosoma.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_209, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2488, position: 3, content: "Onjo yange kilu, ya posoka cimue; \nOmbembua lesanju, ndi sanga eteke! \nLa vosi omanu va solavo Suku \nVa ka kalavo losoma.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_209, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2489, position: 1, content: "Ca sunguluka nga akuetu, \nNda Yesu lika lia’ye \nAmbata omindikiso? \nVa li pi omanu va’e?", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_210, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2490, position: 2, content: "Akuetu, tu kolisiko; \nTu tali ohali la’e. \nTikuli omindikiso, \nHa tu endi kumue la’e.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_210, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2491, position: 3, content: "Nikula omindikiso, \nAyonjo a lua tupu, \nYi kale ye, yi kale ye, \nNdu wupa ongangu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_210, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2492, position: 4, content: "A Yesu, ndo tu kolise, \nSanga tu ci lembua, \nToke tu iñila kulamba, \nKofeka ya Suku.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_210, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2493, position: 1, content: "Ndinge ukuacili, va lua va ñolela. \nNdinge ukuanjelo, va lua va sukila. \nNdinge ukuopami, kuli olohali. \nNdinge ukuotoi, kuli itangi via lua, \nNdinge ukuotoi, kuli itangi via lua.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_211, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2494, position: 2, content: "Ndinge ekamba lia vakuetu vosi. \nNdinge ongavi, puãi si ka lipande. \nNdinge embombe loku liketisa. \nÑolele Suku, njole la vakuetu, \nÑolele Suku, njole la vakuetu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_211, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2495, position: 3, content: "Ndinge ukuambili yoku lilongisa \nEvi viesunga vi ndongisa Suku. \nNjeve vutima ekovongo liaye, \nNdinge lesanju ocipango caye, \nNdinge lesanju ocipango caye.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_211, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2496, position: 1, content: "A Suku, tu longise oku kemainya \nUpange wetu woloneke viosi, \nOco upange wetu wosi u kole, \nLowu wovaka lowu wovitima.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_212, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2497, position: 2, content: "Nda oku fula tu ihe esunguluko \nKa tu ka linge vakuacipululu. \nTu ihe itima vioku sunguluisa \nU pange wosi lolondando viosi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_212, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2498, position: 3, content: "Eci ca penga ka ci ka vihise \nOku fendela kuetu tuakueyovo. \nUpange wetu wosi u linge onyima \nYetavo kuenda yalombelo etu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_212, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2499, position: 4, content: "Tu posuisile ovikuata vietu, \nLevi viovonjo levi vioku lima, \nOco tu tumbangiye Utungi wetu \nLoku kemainya Ongunja ya pua evelo.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_212, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2500, position: 1, content: "A Yesu, a Ñala, hũ sole cimue. \nOve o nyimula ovitua vivi. \nOve Upopeli haive Unjovoli. \nNda sia ku solele hu sola etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_213, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2501, position: 2, content: "Hu sole omo ove wa sola ame. \nHu sole omo wa nalela ohali. \nHu sole omo wa nulila omuenyo. \nNda sia ku solele hu sola etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_213, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2502, position: 3, content: "Hu sola vungende womuenyo ulo. \nHu sola osimbu o nyiha ongusu. \nHu sola kohali lokesumuluho. \nNda sia ku solele hu sola etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_213, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2503, position: 4, content: "Volonjo viulamba lelau ka li pui, \nKovailu ku Suku hu sola enene. \nHu imbila ocisungo cesanju, siti, \nNda sia ku solele hu sola etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_213, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2504, position: 1, content: "Konahulu Daniel \nWa yula ayonjo, \nOmo a lomba Suku yahe; \nLombi lenevo.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_214, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2505, content: "Lingi vakuohande! \nLingi olonoi! \nKo ka kuati usumba, \nKuati puãi utoi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_214, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2506, position: 2, content: "Wakuetavo lia Yesu \nKuoha koluali, \nNdaño va ko pembuli, \nKo ka tokoki.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_214, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2507, position: 3, content: "Ñala Yesu vo tomba, \nVo siya ovate, \nVo tendula ovikusi, \nHaimo o va sole.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_214, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2508, position: 4, content: "Pamue omanu vo yola \nHa vo fuanguila, \nCime cene vo linga \nCimue ca piãla.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_214, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2509, position: 1, content: "A Yesu, a Ñala, hũ vialeka, \nHu lingi soma yange, \nOco vutima wange o viale, \nHaimo o linga Fu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_215, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2510, content: "Si ka ivaleko ekulusu. \nSi ka ivaleko ohali yove. \nOhenda yove yi ñokele \nUtima woku ku vumba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_215, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2511, position: 2, content: "Hu kuame kumue lolondonge; \nMuna vo Ngesemane \nOmo ndimbuke ohali yove, \nNdilile upongo wove.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_215, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2512, position: 3, content: "Ndeci Maria, haico ame \nNgende keyambo liove; \nOko ndimbuke unene wove \nWa yula lawo okufa.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_215, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2513, position: 4, content: "Nyihe ongusu yoku ambata \nOmindikiso yange, \nHa siu ku kuama locisola \nKuosi ove o songuila.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_215, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2514, position: 1, content: "Ndo tu longise,  \nA Cime comuenyo,  \nHa tu pitiya ondaka yeyovo. \nTu longisevo uloño wokilu  \nHa tu tindula omanu kakandu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_216, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2515, position: 2, content: "Ndo tu songuile,  \nHa tu imbi onumbi \nAva va lueya ha va pongoloka \nOve Unekui yutima, tu lise, \nHa tu tekula vakuaku lambuka.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_216, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2516, position: 3, content: "Ndo tu kolise  \nKohanda yomuenyo. \nTu ihe ongusu yutima we lipua. \nOco tu ohele lohenda lepandi \nAva va kasi vohali yayonjo.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_216, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2517, position: 4, content: "Tu kunamise kupange u kola. \nKuosi wa panga,  \nA Ñala tu tume; \nNoke kulamba wa piãla wokilu \nTu ku sivaya lesanju ka li pui.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_216, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2518, position: 1, content: "Fuimile omuenyo wa Suku;  \nNdonge olonduge viocili; \nHa si tekela kuevi o sole, \nNdingevo ndomo Ove.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_217, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2519, position: 2, content: "Fuimile omuenyo wa Suku \nToke utima u yela, \nHo kuata epandi ndeli lia Yesu, \nSi pama kolohali.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_217, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2520, position: 3, content: "Fuimile omuenyo wa Suku, \nNave ocili ku Yesu, \nNdokuti ocipango cetimba \nCi kuate owuya waye.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_217, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2521, position: 4, content: "Fuimile omuenyo wa Suku \nNdokuti si fi vali, \nSi kala love otembo yosi \nKomuenyo una ko pui.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_217, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2522, position: 1, content: "Okua Yesu, ku ka sime \nOku sanga epuyuko; \nWa ñualiwa lovanyali; \nLavulula. Lomba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2523, position: 2, content: "Ovonene vowelema \nVa ku ñuala ocingonja \nHa va nyoli etavo liove; \nLavulula. Lomba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2524, position: 3, content: "Tata imaleho viove, \nVina via ku avela Suku, \nNdaño utanya, ndaño uteke, \nLavulula. Lomba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2525, position: 4, content: "Yevelela olonjuli \nVina via yula ale osimbu. \nVi li loku ku lungula, \nLavulula. Lomba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2526, position: 5, content: "Puãi ca piãla yevelela \nCime cove wa ku fila. \nKu ka ivale ondaka yaye, \nLavulula. Lomba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_218, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2527, position: 6, content: "Lavulula sanga Uyonji \nIya onyola onima yove. \nLomba ongusu yoku yula. \nLavulula. Lomba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_218, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2528, position: 1, content: "Wa nyiha ocikundi \nCoku ku kuama, a Yesu. \nÑuatise, ñolise  \nLongusu yi kola. \nNyihe utima wombili.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_219, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2529, position: 2, content: "Wa nyiha ocikundi \nCoku liuvika keviho. \nA Yesu, mbokiye  \nOnjelo yutima; \nNdinge ombangi yocili.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_219, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2530, position: 3, content: "Wa nyiha ocikundi \nCoku kuatisa vakuetu. \nA Yesu, nuwise  \nOmbembua lohenda \nKuenda utima wonjuka.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_219, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2531, position: 4, content: "Wa nyiha ocikundi \nCoku longisa omanu. \nA Yesu, ndo muise  \nuloño wokilu \nSi va tavisa kokuove.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_219, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2532, position: 5, content: "Wa nyiha ocikundi \nCoku tikula ekulusu. \nA Yesu, mokuise;  \nNjukinye ekolelo, \nOco hu kuame lesanju.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_219, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2533, position: 1, content: "Nda yeva ondaka ya Ñala Yesu, \nYa sapuila ocisola.\nNjongola oku kala ocipepi la'e, \nUpopeli, Ukuesunga.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_220, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2534, content: "Ocipepi lekulusu lia'e \nNjongola oku kala. \nOcipepi lekulusu lia'e, \nOko sanga ombembua.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_220, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2535, position: 2, content: "Nda likuminya oku tumala \nPolomai via tomiwa \nNdi litumbika ku Ñala yange; \nMokola kondaka ya'e.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_220, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2536, position: 3, content: "Ocisola caye ca sanjuisa; \nWa ñuatela ohenda. \nNda tula utima, nda pua ohele, \nOmo ñasi la Yesu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_220, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2537, position: 1, content: "Omõla a Suku wa votoka \nHa yovola omanu. \nVemehi liepandela liaye \nLetu tu votoki. \nTu likuminyi oku kuama \nKuosi a tu ilikila \nLoku  kolela unene waye \nWoku tu songuila.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_221, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2538, position: 2, content: "Ndeci olombangi vionahulu \nVia pembuile okufa, \nLetuvo etali haico le \nTu lingi olonoi. \nOnima yetu yokovaso \nYi tu muise epandi. \nTu tamãlali levi viosi \nVi tateka esunga.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_221, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2539, position: 3, content: "Tu tiami kocisoko cina \nCavakuekolelo \nVa kolelele ohuminyo  \nYoku sanga eyulo. \nVa sakalaile loku tiula \nOmanu kenyoleho. \nVa imbile ovaso Usongui wavo \nWa va kovongele.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_221, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2540, position: 4, content: "Nda ovivenji, nda akulu, \nAfeko pamue akuenje, \nOmanu va lua va lingile \nOlonoi vietavo \nOhali tupu va ameleko \nToke oku yula \nA Yesu, letu tu kolise \nHa tu yuli ndovo.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_221, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2541, position: 1, content: "Tua nena kamue ku Suku \nLonjelo yutima; \nNdaño citito tu kuete \nPuãi tu ecaño kamue.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_222, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2542, position: 2, content: "Eye wa tu iha viapiãla \nTe tu wiha kamue; \nOhenda yahe yalova, \nTu panduila ño hu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_222, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2543, position: 3, content: "Tua nenavo ovisimilo \nKu Suku yesunga; \nTu mola ulamba wenda hu \nOtembo ka yi pui.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_222, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2544, position: 4, content: "Amala akulu panduili \nOcali ca Suku; \nNdaño tua mola evi levi, \nMomo liohenda yahe. Amen.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_222, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2545, position: 1, content: "Cosi cange, cove a Yesu, \nCosi ndi ci tumbika. \nSiu ku vumbi, siu ku soli; \nOve lika, Ove hũ.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_223, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2546, content: "Ndi li tumbika, \nNdi li tumbika, \nCosi cange cove a Yesu \nNdi li tumbika.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_223, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2547, position: 2, content: "Cosi cange cove a Yesu \nÑekamela polomai. \nOluali luosi lu sialepo \nNambule ame ndopuilo.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_223, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2548, position: 3, content: "Cosi cove hacangeko. \nOve Cime ndupika; \nUspiritu njimbe owanji, \nCosi ndi ci tumbika.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_223, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2549, position: 4, content: "Cosi cange cove a Yesu, \nNdi li eca kokuove \nNjukiseko locisola; \nSumuluise lamele.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_223, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2550, position: 5, content: "Cosi cange cove a Yesu \nNda ci likuminyile, \nNjolela lesanju lialua, \nSivayala cenda hu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_223, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2551, position: 1, content: "Ha eca cosi ku Yesu \nLongusu yange yosi \nNgecavo ovisimilo \nLotembo yange yosi", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_224, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2552, content: "Ha eca cosi ku Yesu \nLongusu yange yosi. \nHa eca cosi ku Yesu \nLomuenyo wange wosi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_224, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2553, position: 2, content: "Ndinge ño upange wahe; \nNgendela vonjila yahe. \nMole Yesu otembo yosi, \nNjimba esivayo liahe.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_224, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2554, position: 3, content: "Nda njimba ovaso ku Yesu \nNjivala evi violuali; \nNda mbanja komindikiso, \nNdimbuka Cime cange.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_224, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2555, position: 1, content: "Peka liove a Suku, \nTu eca cosi tu kuete. \nKuenda cosi wa tu iha, \nLongusu yetu yosi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_225, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2556, content: "A Ñala yetu tambula, \nA Suku yetu tambula, \nTambula, cosi tu kuete.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_225, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2557, position: 2, content: "Viosi vi tunda kokuove, \nViosi viove tu vi tiula, \nKa kuli eci okuti cetu, \nCosi kokuove ci tunda.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_225, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2558, position: 3, content: "Tava ocilumba cetu, \nLeci cetu covutima. \nTu simavo ekolelo, \nEvi viosi ove o tu ihã, ihã!", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_225, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2559, position: 1, content: "Yesu Cime cange ndila \nWa ñuatisa nda si okufa. \nWa nyiya eyovo lia lua \nNambule ndomo ñasi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_226, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2560, content: "Nambule ndomo ñasi \nNambule ndomo ñasi \nYesu wa fila ame kuti! \nNambule ndomo ñasi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_226, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2561, position: 2, content: "Ñuatise nda yuka akandu\nLosonde yove njelisua \nOve ku ndingi civi mbu, \nNambule ndomo ñasi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_226, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2562, position: 3, content: "Metama pomangu yove, \nVukuahenda wa njovola; \nWa lemulula upange, \nNambule ndomo ñasi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_226, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2563, position: 4, content: "Wa ndingilavo upange, \nWa mongoluisa utima; \nKupange waco lame le, \nNambule ndomo ñasi.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_226, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2564, position: 1, content: "Yeva ondaka yekovongo \nYiti helie ndi tuma. \nOvapia a yela ale; \nTu fetiki oku ungula; \nÑala Yesu wa kovonga, \nWa likuminya onima, \nHelie otambulula hati \nAmilo va nume ño.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_227, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2565, position: 2, content: "Ka kovonge vakuakandu, \nOkuahenda Anjovoli. \nSindikila otumeme \nLovoko ove a pama; \nTuala kitima via teka \nOndaka yove yombembua. \nSapula  koluali luosi \nHati tambuli eyovo.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_227, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2566, position: 3, content: "Ku ka sime okuetu hati, \nSikuete ocikele; \nTala omanu vali oku fa, \nAwiñi vali votokua \nÑala oli loku kovonga; \nYeva kekovongo liahe; \nTava ndopo yayulako, \nAmilo va nume ño.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_227, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2567, position: 1, content: "Wa sumuluha omunu \nKa endi ndu kualofeka; \nNdaño lava va kuakandu, \nKa kuete ukamba, \nKa kuete ukamba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2568, position: 2, content: "Pole vo cihandeleko, \nCikola ca Suku; \nOku kundikamo utima, \nCi sanjuisa Suku, \nCi sanjuisa Suku.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2569, position: 3, content: "Ndeci omunu amamako, \nHaico ocikula eci; \nCikasi ocipepi lolui, \nCimaima apako awa, \nCimaima apako awa.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2570, position: 4, content: "Emela liaco ka li loka, \nNdaño okuvuka mbu; \nLikõla, lipia otembo hu... \nEpako uti a eca, \nEpako uti a eca.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2571, position: 5, content: "Vakualofeka hacoko \nEsanju kakuli; \nVa kala ndo neketela, \nOfela ya ambata, \nOfela ya ambata.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_228, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2572, position: 6, content: "Kesombiso vapisiwa \nKeteke lia Ñala \nKu va kuesunga ocipãla \nVa sanga evalo hu, \nVa sanga evalo hu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_228, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2573, position: 1, content: "Nyihe onjongole \nYoku suvuka evihõ; \nKesumuo ndujuke, \nNdi lipue vali, \nNdilue kekolelo, \nLelitumbiko, \nKuenda oku U vumba, \nHaico okulomba.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_229, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2574, position: 2, content: "Ndinge ukuesunga \nUkua londunge via lua, \nÑole ngõ vupange, \nLombili yalua, \nKomuenyo ndi miuhe, \nSimuile elueyo; \nÑale ukuepokolo, \nUkuacisola.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_229, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2575, position: 3, content: "Nyihe vali onjelo, \nKu Yesu ndi kole, \nMbiale, ñuata ombembua \nKekulusu eli, \nKomuenyo ndi miuhe, \nNduise ovopange, \nNjongola kovailu, \nHu litumbika.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_229, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2576, position: 1, content: "Ndeci wa popele lukuenje Samuele, \nOlondaka viwa,  \nOlondaka viomuenyo, \nHu pinga vo a Suku yange: \nNdo ndongise vo lame le, \nNdo ndongise vo lame le.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_230, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2577, position: 2, content: "Olondaka viove ndivi yeva lutate. \nNdaño kovisimilo si ku lueyela. \nPole sanjukila ño hũ, \nPoku yevelela Suku, \nPoku yevelela Suku.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_230, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2578, position: 3, content: "Embimbiliya ondaka ya Suku. \nOsoma yenda hũ,  \nOmbanguisa viokilu. \nLesumbilo ndi vi sola \nKuenda oku vi kuliha, \nKuenda oku vi kuliha.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_230, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2579, position: 4, content: "Ndi yevelele ciwa ovilongua viahe, \nLoku linga upange  \nWahe lutima wa yela. \nNdeci okamõla kepandi; \nNdeci ukuenje Samuele, \nNdeci ukuenje Samuele.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_230, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2580, position: 1, content: "Suku otu kovonga, \nOco tu litumbike \nKupange Wa’e ukola; \nTu sandeki usoma Wa’e. \nTu tavi lonjolela, \nTu eci cosi kokuaye \nKuenje tu lieci olumue \nTuti etu valo a Ñala.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_231, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2581, position: 2, content: "Tu tiami konjovoli, \nLekolelo liasuapo \nVunene Wa’e tu sanga \nOno yongusu. \nLupami tu yoleli, \nEtu tutalavaya, \nLoku nena ku Kristu \nVosi va kuakandu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_231, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2582, position: 3, content: "Kumue luvangi wetu \nTukuami Ñala Yesu; \nOmuenyo wetu wa lipua \nUsandula ocinyi. \nA Ñala Spiritu liove, \nLitumale letu; \nKuenda onjongole Yove \nYikale hu letu.", hymnsNumber: UmHymnsNumberSeeder.OKU_LITUMBIKA_231, typeStanza: HymnsContentCode.VERSE),
  ];
}